import React from 'react';
import { useNavigate } from 'react-router-dom';
import "./Chapter1EducationalPage.css";

export const Chapter1EducationalPage = (text) => {
  let navigate = useNavigate();

  const routeChange = () => {
    let path = '/chapter_2';
    navigate(path);
  }

  return (
    <div>
      <h1>{text}</h1>
      <p>Here are some things to look out for in Love Scams & Tips to keep you safe</p>
      <ol>
        <li><p>Stay Informed</p></li>
        <li>
            <p>Look out for fake profiles -- pay attention to overly poetic phrases, 
                repetitive words and inconsistencies in their pictures and words</p>
        </li>
        <li></li>
      </ol>
      <div className="move-on">
        <button onClick={routeChange}>Chapter 2</button>
      </div>
    </div>
  )
}
